import React from "react";

export default function Bio() {
    return (
        <article className="bio">
            <h2 className="bio-h">About</h2>
            <p className="bio-p">God. Love. Life. Lorem ipsum dolor sit amet, consectetur adipisicing elit. Sunt excepturi, qui commodi earum cupiditate exercitationem explicabo, similique quisquam, alias voluptatum corrupti maiores magnam rerum saepe! Unde molestias recusandae deleniti nulla.</p>
            <h2 className="bio-h">Interests</h2>
            <p className="bio-p">Quantum mechanics. Being God. Making startups. Giving Leo mod.</p>
        </article>
    );
}
